g2:c.METHOD.g2:a.TEXT:
get-event-listener-list (self: class g2-event-listener-support) = (class item-list) begin
return the _event-listeners of self;
end

remove-g2-event-listener(self: class g2-event-listener-support, listener : class g2-event-listener) begin
remove listener from the _event-listeners of self;
end

g2:c.PROCEDURE.g2:a.TEXT:
G2-EVENT-CREATE-EVENT(event-class: class class-definition, source : class item)  = (class g2-event-object) 
event : class G2-EVENT-OBJECT;
begin
    create an instance event of the class named by the class-name of event-class;
    conclude that the source of event = sequence(source);
    return event;
end
